import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import signupImage from './interviewsignup.jpg';


const Signup = () => {
  const [form, setForm] = useState({ name: '', email: '', password: '', skills: '' });
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch('http://localhost:5000/api/auth/signup', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(form)
      });
      const data = await res.json();
      if (!res.ok) throw new Error(data.msg);
      localStorage.setItem('token', data.token);
      navigate('/');
    } catch (err) {
      setError(err.message);
    }
  };

  return (
    <div className="min-h-screen flex flex-col bg-black text-white">
      <header className="text-center p-6 text-3xl font-semibold">"Sharpen your skills with prep4Sde! ðŸš€"</header>
      <div className="flex flex-1 justify-center items-center">
        {/* Left Image Section */}
        <div className="hidden md:flex w-1/2 justify-center">
          <img 
            src={signupImage}
            alt="Visual Mockup"
            className="max-h-[500px] rounded-xl"
         />
        </div>

        {/* Signup Form Section */}
        <div className="w-full md:w-1/2 p-6 max-w-md mx-auto">
          <h1 className="text-4xl font-bold mb-6 text-center font-serif">prep4Sde</h1>

          <form onSubmit={handleSubmit} className="space-y-4">
            <input
              type="text"
              name="name"
              placeholder="Name"
              className="w-full p-2 bg-gray-800 rounded"
              onChange={handleChange}
              required
            />
            <input
              type="email"
              name="email"
              placeholder="Email"
              className="w-full p-2 bg-gray-800 rounded"
              onChange={handleChange}
              required
            />
            <input
              type="password"
              name="password"
              placeholder="Password"
              className="w-full p-2 bg-gray-800 rounded"
              onChange={handleChange}
              required
            />
            <input
              type="text"
              name="skills"
              placeholder="Skills (comma separated)"
              className="w-full p-2 bg-gray-800 rounded"
              onChange={handleChange}
              required
            />

            {error && <p className="text-red-500 text-sm">{error}</p>}

            <button type="submit" className="w-full bg-indigo-500 hover:bg-indigo-600 text-white py-2 rounded">
              Sign Up
            </button>
          </form>

          <p className="text-sm text-center mt-4">
            Already have an account? <a href="/login" className="text-blue-400 hover:underline">Login</a>
          </p>
        </div>
      </div>

      <footer className="text-center py-4 border-t border-gray-700 text-sm">
        <div className="space-x-4">
          <a href="#" className="hover:underline">Privacy Policy</a>
          <a href="#" className="hover:underline">Terms</a>
          <a href="#" className="hover:underline">About</a>
          <a href="#" className="hover:underline">Help</a>
          <a href="#" className="hover:underline">Contact</a>
        </div>
        <p className="mt-2 text-gray-500">Â© {new Date().getFullYear()} prep4Sde</p>
      </footer>
    </div>
  );
};

export default Signup;
